/*
Common: Change disk (0..2) after 180s

If audio is not in sync: restart (alt+down) while shader is playing
*/

void mainImage(out vec4 C, in vec2 O)
{
    vec2 f = vec2(
        10., // seconds
        12. * 10. // half-tones
    ) / iResolution.xy;
    float t = min(iTime, t_disk) + t_offset;
    vec2 d = vec2(
        t - 1.,
        0
    );

    C = vec4(0);
    if (abs(O * f - 1.).x < .6 * f.x)
        C = vec4(1);

    vec2 o = O * f + d;
    for (int i=min(0,iFrame) ; i<n_notes ; ++i)
    {
        vec4 note = notes(i);
        if (note.w == -1.)
            continue;
        if (note.x < o.x && o.x < note.x + note.z && int(o.y) == int(note.y))
        {
            if (note.x + note.z < t)
                C = vec4(0,0,1,1);
            else if (note.x < t)
                C = vec4(0,1,0,1);
            else
                C = vec4(1,0,0,1);
        }
    }

    if (iTime > t_disk)
    {
        C = mix(C, vec4(.5,.5,.5,1), .5);
        f = vec2(1. / iResolution.y);
        vec2 uv = (O - iResolution.xy / 2.) * f;
        uv = abs(uv);
        uv.x = abs(uv.x - .2);
        C = mix(C, vec4(1), float(uv.x < 0.1 && uv.y < .3));
    }
}

float pitch(float i)
{
    return 440. * pow(2., (i - 60.) / 12.);
}

vec2 wave(float f, float a, float time)
{
    float w = 2. * pi * f * time;
    //float v = pow(abs(sin(w / 2.)), 8.) - .5;
    float v = pow(max(0., (sin(w) + 1.) / 2.), 8.) - .5;
    return vec2(a * v);
}

vec2 mainSound(int samp, float time)
{
    vec2 sound = vec2(0);

    float t = time + t_offset;
    for (int i=min(0, int(iSampleRate)) ; i<n_notes ; ++i)
    {
        vec4 note = notes(i);
        if (note.w == -1.)
            continue;
        if (note.x < t && t < note.x + note.z)
        {
            float f = pitch(note.y);
            float a = smoothstep(0., .05, t - note.x) * smoothstep(.0, -.05, t - (note.x + note.z));
            sound += wave(f, .05 * a * clamp(800. / f, 1., 10.), time);
        }
    }

    return sound;
}
